window.bookSummaryJSON = "<p><b>Escaping from an angry drone graveyard with the help and sacrifice of one of her own kind, Alex finds herself in a fringe system populated by mankind, a species that would fear and hate her if they knew the truth.</b></p> <p>Still, she cant wait to see the new sights and make more friends! She just has to be a little subtle about it... And maybe trade in some anti-matter nuclear warheads.</p> <p>But faking it until you make it can lead to unforeseen consequences, and when those involve dropping megatons of munitions on a perhaps misunderstood alien species, the stakes can be raised even higher.</p> <p>When placed as the only thing between a people about to be annihilated, can Alex turn away? Her choice might leave her with consequences she never dared imagine.</p> <p>War is good for Business. Business depends on Diplomacy. Diplomacy warrants... Cakes and Kebabs?</p> <p><b>Book 2 of this spacefaring, survival LitRPG Adventure filled with game elements, vivid characters that are easy to root for, an evolving A.I., explosive ship battles, strategic combat</b>,<b> civ-building, base building,</b> <b>and so much more. Grab your copy today!</b></p> <p><i>With over 4 million views as a smash-hit web-serial, experience the definite version of this epic story on Kindle, Kindle Unlimited, and Audible.</i></p>"; 
